import '../styles/Match.css';

function Match() {
    return (
        <div className='card'>
            <img src='#'></img>
            <div className='card-body'>
                <div className="info">
                    <h4 className='card-title'> Title </h4>
                    <p>Time and Date</p>
                </div>
                <span>8/10p</span>
                <button>Join Game</button>
            </div>
        </div>
    );
}

export default Match;
